import 'package:google_maps_flutter/google_maps_flutter.dart';import 'package:shiftapp/presentation/shared/components/index.dart';import '../../../../data/models/add_round_trip_fill_station_prams.dart';import '../../../../domain/entities/gas_station_trip.dart';import '../../../../domain/entities/index.dart';import '../widget/gas_stations_plane_item.dart';class GasStationsPlaneScreen extends BaseStatelessWidget {  final List<GasStationTrip> state;  final Function(AddRoundTripFillStationPrams params,LatLng latLng) onAddRoundTripFillStation;  final CurrentRoundTrip currentRoundTrip;  GasStationsPlaneScreen({    Key? key,    required this.state,    required this.currentRoundTrip,    required this.onAddRoundTripFillStation,  }) : super(key: key);  @override  Widget build(BuildContext context) {    return ListView.builder(      itemCount: state.length,      itemBuilder: (context, index) {        return GasStationsPlaneItem(            item: state[index],            currentRoundTrip: currentRoundTrip,            onAddRoundTripFillStation: onAddRoundTripFillStation);      },    );  }}